const Myheader = ({leftChild, headText, rigthChild}) => {
    return (
        <header>
            <div className={"head_left_btn"}>
                {leftChild}
            </div>
            <div className={"head_text"}>
                {headText}
            </div>
            <div className={"head_right_btn"}>
                {rigthChild}
            </div>
        </header>
    )
}

export default Myheader;
